export const SET_SEARCH_RESULTS = (results) => {
    return {
      type: 'SET_SEARCH_RESULTS',
      payload: results
    };
  };
  
  export const UPDATE_SEARCH_RESULTS = (results) => {
    return {
      type: 'UPDATE_SEARCH_RESULTS',
      payload: results
    };
  };
